import React from 'react'
import { HomePage, About, Resume, Footer } from "../pages";
import { Project} from "../components"

const Main = () => {
  return (
    <React.Fragment>
        <NavBar />
        <HomePage />
        <About />
        <Project />
        <Resume />
        <Footer />
    </React.Fragment>
  )
}

export default Main
